DROP TABLE IF EXISTS `songs`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `songs` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `kh_title` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `en_title` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `lyric` text COLLATE utf8_unicode_ci,
  `play_number` int(11) DEFAULT '0',
  `download_number` int(11) DEFAULT '0',
  `url` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `image` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `bg_image` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `keyword` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `album_id` int(11) DEFAULT NULL,
  `country_id` int(11) DEFAULT NULL,
  `promotion_image_id` int(11) DEFAULT NULL,
  `user_id` int(11) DEFAULT NULL,
  `created_at` datetime NOT NULL,
  `updated_at` datetime NOT NULL,
  PRIMARY KEY (`id`),
  KEY `index_songs_on_keyword` (`keyword`),
  KEY `index_songs_on_album_id` (`album_id`),
  KEY `index_songs_on_country_id` (`country_id`),
  KEY `index_songs_on_promotion_image_id` (`promotion_image_id`),
  KEY `index_songs_on_user_id` (`user_id`),
  CONSTRAINT `fk_rails_a7a738f6de` FOREIGN KEY (`promotion_image_id`) REFERENCES `promotion_images` (`id`),
  CONSTRAINT `fk_rails_a96ab54fb6` FOREIGN KEY (`country_id`) REFERENCES `countries` (`id`),
  CONSTRAINT `fk_rails_d36a8dd57d` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`),
  CONSTRAINT `fk_rails_f4e40cd655` FOREIGN KEY (`album_id`) REFERENCES `albums` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=863 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

