INSERT INTO `songs` VALUES (1,'កុំចោទបងមេរំខាន',' Kom Chot Bong Me Romkhan','',136,5,'https://storage.googleapis.com/song24h/Leap/SASDA%20Production/SASDA%20Production%20CD%20Vol%2013/01.%20Kom%20Chot%20Bong%20Chea%20Me%20Romkhan%20(Pich%20Thana).mp3','V13.png','18.jpg','ផលិតកម្ម សាស្តា Sasda Production\n      កុំចោទបងមេរំខាន  Kom Chot Bong Me Romkhan សាស្តា អាល់ប៊ុម ១៣ Sasda Album 13 កម្ពុជា\n      Cambodia Pich Thana ពេជ្រ ថាណា Sad song មនោសញ្ចេតនា',1,1,NULL,4,'2015-12-22 07:55:20','2016-02-14 04:27:17'),(2,'ស្តាប់បទនេះហើយធ្វើឲ្យបងនឹកអូន','Sdab Bort Nes hery Tver Oy Bong Nek Oun ','',36,5,'https://storage.googleapis.com/song24h/Leap/SASDA%20Production/SASDA%20Production%20CD%20Vol%2013/02.%20Sdab%20Bort%20Nes%20hery%20Tver%20Oy%20Bong%20Nek%20Oun%20(Pich%20Thana).mp3','V13.png','19.jpg','ផលិតកម្ម សាស្តា Sasda Production\n      ស្តាប់បទនេះហើយធ្វើឲ្យបងនឹកអូន Sdab Bort Nes hery Tver Oy Bong Nek Oun  សាស្តា អាល់ប៊ុម ១៣ Sasda Album 13 កម្ពុជា\n      Cambodia Pich Thana ពេជ្រ ថាណា Sad song មនោសញ្ចេតនា',1,1,NULL,4,'2015-12-22 07:58:08','2016-02-14 04:27:38'),(3,'វត្តមានគេជាសមុទ្រទឹកភ្នែកបង','Wattamean ke chea samut toek pnek bong','<p>បទ៖វត្តមានគេជាទឹកភ្នែកបង</p>\r\n\r\n<p>១​ អោបគេនឹកពេលអូនឳបបងផងទោះបីអូនដកបេះដូង យកឲ្យអ្នកថ្មីថែក៏ដោយចុះ បងយំព្រោះបងស្រលាញ់អូនស្មោះ សូមអូនចាំទុកចុះបើផែនដីនៅតែវិល បងនៅតែនឹកអូនបារម្ភអូនគ្មានថ្ងៃភ្លេច។</p>\r\n\r\n<p>២ ត្រចៀកស្តាប់ឮធ្វើថ្លង់ទាំងភ្នែកមើលឃើញក៏ទ្រាំធ្វើខ្វាក់ ស្រលាញ់អូនម្នាក់បងសុខចិត្តធ្វើជាមនុស្សល្ងង់ ទោះបីដឹងថាមានអ្នកក្បត់ក៏ទ្រាំខាំមាត់ព្រោះខ្លាចបាត់បង់ តែចុងក្រោយនៅតែបែក។</p>\r\n\r\n<p>៣ វត្តមានគេជាសមុទ្រនៃទឹកភ្នែកបង គេថើបអូនម្តងបងឈឺអស់មួយជីវិត ពេលគេក្រសោបកាយអូនជាពេលមួយដែលបងខូចចិត្ត ព្រោះដឹងថាអស់សិទ្ធិធ្វើជាម្ចាស់បេះដូងអូនរហូតហើយ</p>\r\n\r\n<p>បន្ទរ៖ ហេតុអ្វីៗអូនងាយឲ្យបេះដូងទៅអ្នកផ្សេង ឫមួយគ្រាមុនអូនស្រលាញ់បងលេង ទុកគ្រាន់កំដរអារម្មណ៍ ប្រាប់មកហេតុអ្វីធ្វើឲ្យបងយំ ឫបងល្អមិនគ្រប់គ្រាន់ មិនចំចំនុចមនុស្សអូនចង់បាន ដឹងទេបងឈឺប៉ុនណារាប់លានអនុស្សារ បងនៅនឹងមុខរាល់ថ្ងៃ នឹកអូនពេកត្រឹមថើបរូបថតស្រីដូចមនុស្សឆ្កួត</p>\r\n\r\n<p>(ច្រៀងឡើងវិញ ១​-៣-១-បន្ទរ)</p>\r\n',162,5,'https://storage.googleapis.com/song24h/Leap/Sunday%20Production/Sunday%20CD%20Vol%20205/01.%20Wattamean%20ke%20chea%20samut%20toek%20pnek%20bong-Khemarak%20Sereymun.mp3','Vol_205.jpg','1.jpg','ផលិតកម្ម សាន់ដេ Sunday Production\n      វត្តមានគេជាសមុទ្រទឹកភ្នែកបង Wattamean ke chea samut toek pnek bong សាន់ដេ អាល់ប៊ុម ២០៥ Sunday Album 205 កម្ពុជា\n      Cambodia Khemarak Sereymon ខេមរៈ សិរីមន្ត Sad song មនោសញ្ចេតនា',2,1,NULL,4,'2015-12-22 08:11:32','2016-02-07 04:27:38'),(4,'ប្ដីអាវ៉ាសែ',' Pdey ava sae','<p><strong>បទ៖ ប្តីអាវ៉ាសែ</strong></p>\r\n\r\n<p>១ នឹកឃើញរឿងចាស់សែនខ្មាស់កន្លង ធ្វើបាបនួនល្អងគិតតែសប្បាយមិត្តភក្តិហ៊ឺហាចាយលុយគ្មានស្តាយ ទ្រូងអូនស្ទើរធ្លាយទឹកភ្នែកសោកា។</p>\r\n\r\n<p>២ ពេលបានលេងល្បែងគ្មានខ្វល់អ្វីឡើយ ដល់ចាញ់អស់ហើយយកលេសដោះសារ វីវក់វង្វេងញៀនស្រីញៀនស្រាចិត្តពាលឫស្យាប្រពន្ធកូនទោម្នេញ។</p>\r\n\r\n<p>៣ ញាតិមិត្តលួចសើចគេលែងរាប់រក រូបខ្ញុំសែនថោក ថោកជាងទំនិញ អស់លុយពីខ្លួនអស់មនុស្សស្រលាញ់ លាហើយសូមចាញ់ថ្នាំស្រីស្រាល្បែង។</p>\r\n\r\n<p>៤ ខ្ញុំច្រៀងបទនេះផ្ញើញាតិប្រុសស្រី កុំត្រាប់តាមអីសង្គមដៀលជេរ ច្រៀងទាំងទឹកភ្នែកសូមទោសមាសមេ ប្តីអាវ៉ាសែស្ម័គ្រកែកំហុស។</p>\r\n\r\n<p>(ច្រៀងឡើងវិញ ៣-៤)</p>\r\n\r\n<p>&nbsp;</p>\r\n',65,0,'https://storage.googleapis.com/song24h/Leap/Sunday%20Production/Sunday%20CD%20Vol%20205/02.%20Pdey%20ava%20sae-Khemarak%20Sereymun.mp3','Vol_205.jpg','4.jpeg','ផលិតកម្ម សាន់ដេ Sunday Production\n      ប្ដីអាវ៉ាសែ  Pdey ava sae សាន់ដេ អាល់ប៊ុម ២០៥ Sunday Album 205 កម្ពុជា\n      Cambodia Khemarak Sereymon ខេមរៈ សិរីមន្ត Sad song មនោសញ្ចេតនា',2,1,NULL,4,'2015-12-22 08:46:29','2016-02-20 23:56:32'),(5,'សង្សារក្រជូនពរអូន','Songsa kror chunpor oun','<p><strong>បទ៖សង្សារក្រជូនពរអូន</strong></p>\r\n\r\n<p>១ បងឮអូនច្រៀងរៀបរាប់សេចក្តី&nbsp;&nbsp;&nbsp; រ៉ាយរ៉ាប់ថាស្រីពិសីស្មោះនឹងស្នេហ៍ណាស់</p>\r\n\r\n<p>​​&nbsp; អូនព្រមរៀបការក៏ព្រោះចាស់ៗ&nbsp;&nbsp;&nbsp;&nbsp; បង្ខំប្តូរផ្លាស់ឲ្យអូនរៀបការគូរថ្មី</p>\r\n\r\n<p>២ វាចាស់កម្រិលពេកណាស់ទៅហើយ&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ឳសង្សារអើយមិនបាច់អូនប្រឹងបំភ្លៃ</p>\r\n\r\n<p>បើជ្រើសយកគេរៀបការចុះថ្លៃ&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; តែសូមចិត្តស្រីកុំក្រឡៃដាក់ចាស់ទុំ</p>\r\n\r\n<p>R. បងដឹងបងក្រគេមានដល់ក&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ស្រីល្អគិតថាសាកសម</p>\r\n\r\n<p>យកលេសផ្តេសផ្តាសចោទដាក់ចាស់ទុំ&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ហើយថែមទាំងចោទព្រហ្មលិខិត</p>\r\n\r\n<p>៣ អរគុណពីមុនដែលស្រលាញ់បង&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; កុំព្រួយនួនល្អងថាបងទៅរំខានស្រី</p>\r\n\r\n<p>ពីសង្សារក្រជូនពរពិសី&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; សូមឲ្យរូបស្រីចរណៃអូនបានសុខា</p>\r\n\r\n<p>(ច្រៀងឡើងវិញ R-៣-បន្ទរថែម បងរស់ឈឺចាប់ក៏វាមិនថ្វី)</p>\r\n',65,0,'https://storage.googleapis.com/song24h/Leap/Sunday%20Production/Sunday%20CD%20Vol%20205/03.%20Songsa%20kror%20chunpor%20oun-Khemarak%20Sereymun.mp3','Vol_205.jpg','2.jpg','ផលិតកម្ម សាន់ដេ Sunday Production\n      សង្សារក្រជូនពរអូន Songsa kror chunpor oun សាន់ដេ អាល់ប៊ុម ២០៥ Sunday Album 205 កម្ពុជា\n      Cambodia Khemarak Sereymon ខេមរៈ សិរីមន្ត Sad song មនោសញ្ចេតនា',2,1,NULL,4,'2015-12-22 08:52:24','2016-01-16 03:07:43'),(6,'អត់ខ្វល់សំខាន់អូនស្អាត','Ot kvol somkhan oun saart','<p><strong>បទ៖អត់ខ្វល់សំខាន់អូនស្អាត</strong></p>\r\n\r\n<p>១ មានសង្សារមួយមុខ cute ម្លេះទេ ប៉ុន្តែអត់ធ្វើអីទេម៉ោង១០ទើបក្រោកណា៎</p>\r\n\r\n<p>ហើយពូកែខាងង៉ក់ង រករឿងមិនឈប់មិនឈរ បើខ្ញុំមិនពូកែទ្រច្បាស់ជារឿងធំ។</p>\r\n\r\n<p>២ មានសង្សារស្អាត ចេះតែទ្រាំទៅ​ តែមករអ៊ូង៉ូវៗប្រាប់តែមិត្តភ័ក្តិណា៎</p>\r\n\r\n<p>ពួកវាស្តីឲ្យខ្ញុំថា ម្តេចឯងមិន change ទៅណា ខ្វះណាស់ស្រីពេញលោកាម្តេចឯងមិនយក។</p>\r\n\r\n<p>៣ ណាត់ជួបជីវ៉ា ចង់និយាយឲ្យវាច្បាស់ការ អូនថាអត់ខ្វល់ទេណា សំខាន់អូនស្អាត</p>\r\n\r\n<p>បងចង់គិតអីគិតទៅ ចង់បែកឫក៏ចង់នៅ ពេលនេះក្នុងចិត្តពាលពៅសំខាន់អូនស្អាត។</p>\r\n\r\n<p>(អូ&hellip;ហួសចិត្ត&hellip;)</p>\r\n\r\n<p>(ច្រៀង១-&gt;២-&gt;៣ ម្តងទៀត)</p>\r\n\r\n<p>(ភ្លេងរួចច្រៀង ៣ ២ដងទៀត)</p>\r\n\r\n<p>(អូ!...................)</p>\r\n',49,2,'https://storage.googleapis.com/song24h/Leap/Sunday%20Production/Sunday%20CD%20Vol%20205/04.%20Ot%20kvol%20somkhan%20oun%20saart-Khemarak%20Sereymun.mp3','Vol_205.jpg','30.png','ផលិតកម្ម សាន់ដេ Sunday Production\n      អត់ខ្វល់សំខាន់អូនស្អាត Ot kvol somkhan oun saart សាន់ដេ អាល់ប៊ុម ២០៥ Sunday Album 205 កម្ពុជា\n      Cambodia Khemarak Sereymon ខេមរៈ សិរីមន្ត Sad song មនោសញ្ចេតនា',2,1,NULL,4,'2015-12-22 08:54:29','2016-01-21 13:45:01'),(7,'គ្មានអ្វីស្រស់ថ្លាជាងស្នេហ៍យើង','Kmean avey sros thla cheang sne yerng','<p>បទ៖គ្មានអ្វីស្រស់ថ្លាជាងស្នេហ៍យើង</p>\r\n\r\n<p>1.សែនសប្បាយពេលបានសារភាពក្តីស្នេហា ព្រោះជីវ៉ាប្រាប់ថាអូនស្នេហ៍បងណាស់ក្នុងបេះដូងអរកន្លងមិនធម្មតាទេ អារម្មណ៍ហាក់ហោះហើរលើផ្ទៃវេហា។</p>\r\n\r\n<p>2.ព្រោះតែអូនទើបបងរំភើបចិត្តយ៉ាងនេះ ស្នេហ៍ឆវីជាងគេនៅក្នុងលោកា ក្តីបំណងធំជាងគេចង់ថែជីវ៉ា តែពេលនេះក្តីប្រាថ្នាដូចបំណង។</p>\r\n\r\n<p>&nbsp; R.បងក៏ស្នេហ៍អូន អូនស្នេហ៍បង ជាបំណងពួកយើងទាំងពីរ យើងនឹងថែក្តី​​​&nbsp;&nbsp; ​ស្នេហ៍នេះ ឲ្យឋិតថេររៀងរហូតទៅទោះមានឧបសគ្គរាប់រយពាន់ មករារាំងបង្វៀងរាំងផ្លូវក៏នៅស្នេហ៍ពៅយ៉ាងនេះ&hellip;។</p>\r\n\r\n<p>3.ក្នុងលោកាគ្មានអ្វីស្រស់ថ្លាជាងស្នេហ៍យើង ស្នេហ៍រុងរឿងព្រោះយើងទាំងពីរអាត្មាព្រមស្ម័គ្រស្មោះយល់ចិត្តគ្នាគឺចប់បញ្ហា នោះស្នេហាយើងស្រស់ថ្លារហូតទៅ៕ (ភ្លេងរួចច្រៀង 1-&gt;2-&gt;R-&gt;3 នោះស្នេហាយើងស្រស់ថ្លារហូតទៅៗៗ)</p>\r\n',41,0,'https://storage.googleapis.com/song24h/Leap/Sunday%20Production/Sunday%20CD%20Vol%20205/05.%20Kmean%20avey%20sros%20thla%20cheang%20sne%20yerng-Khemarak%20Sereymun.mp3','Vol_205.jpg','1.jpg','ផលិតកម្ម សាន់ដេ Sunday Production\n      គ្មានអ្វីស្រស់ថ្លាជាងស្នេហ៍យើង Kmean avey sros thla cheang sne yerng សាន់ដេ អាល់ប៊ុម ២០៥ Sunday Album 205 កម្ពុជា\n      Cambodia Khemarak Sereymon ខេមរៈ សិរីមន្ត Sad song មនោសញ្ចេតនា',2,1,NULL,4,'2015-12-22 09:00:07','2016-01-19 10:59:54'),(8,'ដល់ក បែកក៏បែកទៅ','Dol ko bek ko bek tov','<p>បទ៖ ដល់កបែកក៏បែកទៅ​</p>\r\n\r\n<p>១ យំហើយសុំនៅស្ងាត់ម្នាក់ឯងឲ្យអូនលេងម៉ាអស់ដៃ ដល់ពេលបងត្រូវដាច់អាល័យអ្វី</p>\r\n\r\n<p>ៗបណ្តោយទៅចុះ យំហើយសុំដេកមួយភ្លែតសិនហត់នឹងចំនាយពេលឈ្លោះ ស្រលាញ់ចំណេញតែកំហុសខុសៗខុសអត់ហេតុផល</p>\r\n\r\n<p>២ ប្រាប់អូនតាំងពីដំបូងកុំធ្វើឲ្យបងដល់ក ព្រោះស្រលាញ់ទ្រាំទ្រផ្គាប់ចិត្តនិមល យូរទៅកាន់តែយូរទៅដល់ពេលល្មមបងឆ្អែតឆ្អន់ តោះឥឡូវបែកគ្នាក៏បាន។</p>\r\n\r\n<p>R-​ដល់កប៉ុននេះហើយលែងឲ្យអូនថាបងអន់ ចាំមើលអូនសើចបងសមបានយូរប៉ុណ្ណាពេលដែលគ្មានបងបែកគ្នាក៏បែកទៅមិនទៅតាប៉ែនឹងអូន កុំភ័យបងព្រមបែកហើយតាមសប្បាយទៅ</p>\r\n\r\n<p>(ច្រៀងឡើងវិញ ១-២-R-២-R កុំភ័យបងព្រមបែកហើយតាមសប្បាយទៅ)</p>\r\n',60,2,'https://storage.googleapis.com/song24h/Leap/Sunday%20Production/Sunday%20CD%20Vol%20205/06.%20Dol%20ko%20bek%20ko%20bek%20tov-Khemarak%20Sereymun.mp3','Vol_205.jpg','3.jpg','ផលិតកម្ម សាន់ដេ Sunday Production\n      ដល់ក បែកក៏បែកទៅ Dol ko bek ko bek tov សាន់ដេ អាល់ប៊ុម ២០៥ Sunday Album 205 កម្ពុជា\n      Cambodia Khemarak Sereymon ខេមរៈ សិរីមន្ត Sad song មនោសញ្ចេតនា',2,1,NULL,4,'2015-12-22 09:02:44','2016-01-13 01:59:31'),(9,'ម៉ែឈឺ','Mae chheu','<p>បទ៖ ម៉ែឈឺ​</p>\r\n\r\n<p>១ ស្រែមួយអំពក ដែលឲ្យខ្ញុំរស់តាំងពីតូចដល់កំលោះ បានរស់ព្រោះស្រែនេះហើយតែដល់ពេលនេះខ្ញុំត្រូវឃ្លាតឆ្ងាយអ្នកហើយ លែងបាននៅកៀកជិតកើយលក់ហើយលក់ព្រោះម៉ែឈឺ។</p>\r\n\r\n<p>២ ពុកម៉ែនេះហើយជាអ្នកមានគុណ ឥឡូវលោកឈឺធ្ងន់ទាំងខ្លួនក្រីក្រ តែទោះយ៉ាងណា​ ក៏កូននៅខំត្រដរ បើទោះយើងក្រ យើងក្រតែយើងមានចិត្ត។</p>\r\n\r\n<p>R.ម៉ែមិនទាន់ធូរស្បើយ តែអស់ហើយស្រែទ្រព្យធន់ ដើម្បីអ្នកមានគុណទ្រព្យធន់មិនអាចប្រៀបឡើយ ទោះអស់ប៉ុណ្ណា ក៏កូនមិនរួញរាឡើយ ឲ្យតែម៉ែបានស្បើយ ស៊ូហើយស៊ូព្រោះតែម៉ែ។</p>\r\n\r\n<p>៣ ខំប្រឹងធ្វើការរកប្រាក់ទិញថ្នាំ ថ្ងៃក្តៅក៏ខ្លាំងកម្លាំងមិនទៅឯណា តែម៉ែកុំព្រួយម៉ែនឹងជាណា៎ម៉ែណា៎ នឹងបានទៅវត្តវ៉ា វត្តវ៉ានាពេលភ្ជុមបិណ្ឌ៕</p>\r\n\r\n<p>(ភ្លេងរួចច្រៀង R-&gt;៣)</p>\r\n',35,1,'https://storage.googleapis.com/song24h/Leap/Sunday%20Production/Sunday%20CD%20Vol%20205/07.%20Mae%20chheu-Khemarak%20Sereymun.mp3','Vol_205.jpg','3.jpg','ផលិតកម្ម សាន់ដេ Sunday Production\n      ម៉ែឈឺ Mae chheu សាន់ដេ អាល់ប៊ុម ២០៥ Sunday Album 205 កម្ពុជា\n      Cambodia Khemarak Sereymon ខេមរៈ សិរីមន្ត Sad song មនោសញ្ចេតនា',2,1,NULL,4,'2015-12-22 09:05:07','2015-12-31 10:02:46'),(10,'Stand By Me','Stand By Me','<p>បទ៖ Stand by me​</p>\r\n\r\n<p>១ រាល់រាត្រីដឹងទេ? ថាបងនឹកដល់អូន ចង់ជួបស្ងួន តែពួកយើងនៅឆ្ងាយគ្នាហើយ</p>\r\n\r\n<p>មើលទៅមេឃពេលណា ចិត្តឯកាក៏កើតឡើង សុំចិត្តស្ងួនកុំបែកឆ្វេង Stand by me, stand by me.</p>\r\n\r\n<p>R. So darling darling stand by me, oh&hellip;stand by me, oh darling stand by me, stand by me.</p>\r\n\r\n<p>២ បែកពីអូនចិត្តបងក៏មិនចង់ តែការងាធ្វើឲ្យបងបែកពីអូនមែន តែ​គ្រប់ពេលនឹកពុំងារ</p>\r\n\r\n<p>I won&rsquo;t cry no I won&rsquo;t cry no no no no no I won&rsquo;t cry ​សុំចិត្តស្ងួនកុំបែកឆ្វេង stand by me។</p>\r\n\r\n<p>(ច្រៀង R ​ម្តងទៀត)</p>\r\n\r\n<p>*កុំបែកឆ្វេង កុំបែកឆ្វេង កុំបែកឆ្វេង កុំបែកឆ្វេង&hellip;.Stand by me.</p>\r\n\r\n<p>បងវិលវិញ វិលវិញជួបអូន​ អូ!...កុំបែកឆ្វេង &nbsp;Stand by me.</p>\r\n\r\n<p>៣​ បែកពីអូនមិនចង់ ទេ&hellip;.តែការងារឲ្យបងបែក បែកពីអូនមែនតែចិត្តបងនឹកតែពុំងារ</p>\r\n\r\n<p>(ច្រៀង R ​ម្តងទៀត)</p>\r\n',22,0,'https://storage.googleapis.com/song24h/Leap/Sunday%20Production/Sunday%20CD%20Vol%20205/08.%20Stand%20By%20Me-Khemarak%20Sereymun.mp3','Vol_205.jpg','19.jpg','ផលិតកម្ម សាន់ដេ Sunday Production\n      Stand By Me Stand By Me សាន់ដេ អាល់ប៊ុម ២០៥ Sunday Album 205 កម្ពុជា\n      Cambodia Khemarak Sereymon ខេមរៈ សិរីមន្ត Sad song មនោសញ្ចេតនា',2,1,NULL,4,'2015-12-22 09:07:07','2015-12-28 04:52:00'),(11,'តស៊ូគង់បានជោគជ័យ','Tor su kong ban chok chey','<p>បទ៖ តស៊ូគង់បានជោគជ័យ</p>\r\n\r\n<p>I- បើកើតជាមនុស្សតែងតែមានជួបបញ្ហា ជួបរឿងទុក្ខាជួបនឹងរឿងសើចសប្បាយ</p>\r\n\r\n<p>នៅលាយឡំគ្នារាល់ថ្ងៃ គ្មានអ្នកណាគេចផុតបានឡើយ។</p>\r\n\r\n<p>II- តែខ្ញុំសូមប្រាប់ទៅអ្នកកុំចុះចាញ់ឡើយ បើទោះជាអ្នកជួបបរាជ័យក៏ដោយ ត្រូវចាត់ទុកជាមេរៀន មេរៀនទៅរកជោគជ័យ។</p>\r\n\r\n<p>R ហើយក្រោកពីដួល ហើយដើរទៅមុខ ទោះលំបាកក៏មិនត្រូវឈប់ ដើរទៅមុខទោះតិចឫច្រើន វាប្រសើរជាងត្រឡប់ថយក្រោយ។</p>\r\n\r\n<p>ក្រោកពី Down តាំងចិត្តឲ្យមុត បើដួលហើយក្រោកកុំស្លុត ការព្យាយាមគង់បានសម្រេច</p>\r\n\r\n<p>* សម្រេចដោយការអត់ធ្មត់តស៊ូកុំរួញរា គ្រប់គ្នាត្រូវតែក្លាហាន ជម្នះឧបសគ្គឲ្យបាន គ្រាមួយយើងនឹងបានជោគជ័យ តស៊ូគ្រប់គ្នាត្រូវតែក្លាហាន ជម្នះឧបសគ្គឲ្យបាន គ្រាមួយយើងនឹងបានជោគជ័យ ហូអូ&hellip;. ហូអូ&hellip;. ហូអូ&hellip;. ហូអូ&hellip;. ហូអូ&hellip;. ហូអូ&hellip;.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>គ្រាមួយយើងនឹងបានជោគជ័យ៕ (ភ្លេងរួចច្រៀង II-R-*)</p>\r\n',20,0,'https://storage.googleapis.com/song24h/Leap/Sunday%20Production/Sunday%20CD%20Vol%20205/09.%20Tor%20su%20kong%20ban%20chok%20chey-Khemarak%20Sereymun.mp3','Vol_205.jpg','4.jpg','ផលិតកម្ម សាន់ដេ Sunday Production\n      តស៊ូគង់បានជោគជ័យ Tor su kong ban chok chey សាន់ដេ អាល់ប៊ុម ២០៥ Sunday Album 205 កម្ពុជា\n      Cambodia Khemarak Sereymon ខេមរៈ សិរីមន្ត Sad song មនោសញ្ចេតនា',2,1,NULL,4,'2015-12-22 09:09:33','2015-12-28 04:52:26'),(12,'មានក្ដីសុខប៉ុនណាក្បែរអ្នកថ្មី','Mean kdey sok ponna kbae neak thmey','<p>បទ​៖​ មានក្តីសុខប៉ណ្ណាក្បែរអ្នកថ្មី</p>\r\n\r\n<p>១ បែកគ្នាយួរហើយហេតុអ្វីបង នៅតែមានអារម្មណ៍នឹកដល់អូន ទាំងពេលនេះបងមានគេក្បែរខ្លួន ជំនួសអូនហើយ</p>\r\n\r\n<p>២ ចង់ដឹងអូនកំពុងធ្វើអ្វីខ្លះ មាននឹកសង្សារចាស់នេះខ្លះទេ​ បេះដូងមួយនេះស្រែករកមាសមេស្តាយស្នាមស្នេហ៍ដែលបានបញ្ចប់ហើយ</p>\r\n\r\n<p>៣​ មិនមែនបងតាំងចិត្តនឹកអូន តែបេះដូនងជាអ្នកបញ្ជា​ ពេលខ្លះបងឃើញគេថាជារួបអូន</p>\r\n\r\n<p>R១-ក្បែរសង្សារថ្មីបេះដូងស្រី មានក្តីសុខជាងពេលអូន នៅក្បែរសង្សារចាស់ម្នាក់នេះដែរទេ បងសង្ឃឹមថាគេចេះថ្នាក់ថ្នមថែ មិនធ្វើឲ្យអូនឈឺផ្សាដូចបង</p>\r\n\r\n<p>R២-ពេលបាត់បង់អួនទើបបងដឹង បេះដូងហ្នឹងពិតជាឯកា ទោះមានស្នេហាមានអ្នកថ្មីមើលថែក៏មិនដូចជាពេលមានអូននៅក្បែរ បងពិតជាស្តាយៗអូនខ្លាំងណាស់</p>\r\n\r\n<p>(ច្រៀងឡើងវិញ​១-២-R១-R២-R១-R២ ចប់)</p>\r\n',18,0,'https://storage.googleapis.com/song24h/Leap/Sunday%20Production/Sunday%20CD%20Vol%20205/10.%20Mean%20kdey%20sok%20ponna%20kbae%20neak%20thmey-Khemarak%20Sereymun.mp3','Vol_205.jpg','11.jpg','ផលិតកម្ម សាន់ដេ Sunday Production\n      មានក្ដីសុខប៉ុនណាក្បែរអ្នកថ្មី Mean kdey sok ponna kbae neak thmey សាន់ដេ អាល់ប៊ុម ២០៥ Sunday Album 205 កម្ពុជា\n      Cambodia Khemarak Sereymon ខេមរៈ សិរីមន្ត Sad song មនោសញ្ចេតនា',2,1,NULL,4,'2015-12-22 09:11:31','2015-12-28 04:56:14'),(13,'កំហុសគ្រប់យ៉ាងមកពីរូបខ្ញុំ','Komhos krob yang mok pi rub khjom','',63,4,'https://storage.googleapis.com/song24h/Leap/U2%20Production/U2%20Production%20CD%20Vol%2022/01.%2